package isola.model.ext.tree;import isola.helpers.JsHelper;import isola.model.core.JsObject;/** *  * <p> * This class provides the default UI implementation for Ext TreeNodes. The * TreeNode UI *  * implementation is separate from the tree implementation, and allows * customizing of the *  * appearance of tree nodes. * </p> *  *  *  * <p> * If you are customizing the Tree's user interface, you may need to extend this * class, *  * but you should never need to instantiate this class. * </p> *  *  *  * <p> * This class provides access to the user interface components of an Ext * TreeNode, *  * through Ext.tree.TreeNode.getUI * </p> *  *  *  * @author Umut Gokbayrak */public class TreeNodeUI extends JsObject {	private static final long serialVersionUID = -5887239495004059293L;	private static final String TAG = "Ext.tree.TreeNodeUI";		public TreeNodeUI() {		super();	}		@Override	protected void _postProcessToString() {		super._postProcessToString();	}		@Override	public String toString() {		_postProcessToString();		return "new " + TAG + "(" + JsHelper.printJsObject(this) + ")";	}}